import IUnitInfo from "../../interface/IUnitInfo";
import Unit from "../unitStrategy/Unit";
import MageStrategy from "../unitStrategy/MageStrategy";
import img from "../../../img/Void_Spirit_icon.png";
export default class ArchiMageUnitInfo extends Unit
  implements IUnitInfo {


  constructor() {
    super(new MageStrategy());
    this._unitType = "mage";
    this._HP = 90;
    this._damage = 40;
    this._initiative = 40;
    this._imgPath = img;
  }
}
